import React from 'react'
import { StreetViewService } from '@react-google-maps/api';
import { GoogleMap, LoadScript } from '@react-google-maps/api';


const mapContainerStyle = {
    height: "400px",
    width: "800px"
  };

  const center = {
    lat:  51.5320665,
    lng: -0.177203
  };


function para() {
  return (
    <div>
        <LoadScript
        googleMapsApiKey="AIzaSyAYsO2CGL0YCjMoLk29eyitFC2PIJnJbYE"
        >
        <GoogleMap
    id="circle-example"
    mapContainerStyle={mapContainerStyle}
    zoom={7}
    center={center}
  >
    <StreetViewPanorama
      position={center}
      visible={true}
    />
  </GoogleMap>
  </LoadScript></div>
  )
}

export default para
